.education-form {
  display: flex;
  flex-direction: column;
  gap: 10px;
  overflow: hidden;
}

.education-field {
  display: flex;
  flex-direction: column;
  gap: 10px;
  position: relative;
  padding-right: 50px; /* Space for the remove button */
}

.education-row {
  display: flex;
  gap: 10px;
}

.row1 input {
  padding: 10px;
  border-radius: 5px;
  border: 1px solid #ddd;
}

.row1 input.school {
  flex: 2;
  font-size: 16px;
}

.row1 input.specialization {
  flex: 1.5;
  font-size: 14px;
